pragma solidity 0.4.18;

import '../ownership/Ownable.sol';
import '../math/SafeMath.sol';
import '../token/ERC20.sol';

/**
 * @title Whitelist
 * @dev This contract is a whitelist for the tokensale
 */

contract Whitelist is Ownable {
    using SafeMath for uint256;

    uint256 public endTimeRegister;
    uint256 public count_whitelist = 0;
    uint256 public phaseInitiated = 0;
    bool public paused;
    bool public finished;
    mapping (address => Registrant) private registrants;
    address[20000] private registrantAddr;
    uint256 public latestBonus;
    uint256 bonusAmountPhaseOne = 7200000000000000000000000;
    uint256 bonusAmountPhaseTwoTillSeven = 10000000000000000000000000;

    struct Registrant {
        address addr;
        uint256 tier;
        uint256 latestBonus;
        bool exists;
    }

    event NewWhitelister(address indexed newUser, uint tier);
    event ClaimedTokens(address indexed _claimtoken, address indexed _owner, uint _amount);
    event ContractInitiated(uint256 endDate);

    function () payable public {
        addToWhitelist(msg.sender);
        // give ETH back
        msg.sender.transfer(msg.value);
    }

    function Whitelist(uint256 _endTimeRegister) public {
        //endTime must be in the future
        require(_endTimeRegister > now);
        endTimeRegister = _endTimeRegister;
        paused = false;
        finished = false;
        latestBonus = 0;
        ContractInitiated(endTimeRegister);
    }

    function addToWhitelist(address _newUser) notPaused notFinished public {
        // when started not be able to register to whitelist
        //check if still is in time to register
        require(now<endTimeRegister);
        require(count_whitelist <= 20000);
        // check if already in whitelist
        require(!registrants[_newUser].exists);
        //check valid address
        require(address(_newUser) != 0);
        var registrant = registrants[_newUser];
        registrant.addr = _newUser;
        registrant.latestBonus = 0;
        registrant.tier = getTierForNewAddress();
        registrant.exists = true;
        registrantAddr[count_whitelist] = _newUser;
        count_whitelist = count_whitelist.add(1);
        NewWhitelister(_newUser, registrant.tier);

    }

    function addSelfToWhitelist() notPaused notFinished public {
        addToWhitelist(msg.sender);
    }

    function addMultipleToWhitelist(address[] addresses) onlyOwner public {
        require(count_whitelist <= 20000);
        require(count_whitelist.add(addresses.length) <= 20000);

        for (uint i=0;i<addresses.length;i++) {
            require(!registrants[addresses[i]].exists);
            require(address(addresses[i]) != 0);

            var registrant = registrants[addresses[i]];
            registrant.addr = addresses[i];
            registrant.latestBonus = 0;
            registrant.tier = getTierForNewAddress();
            registrant.exists = true;
            registrantAddr[count_whitelist + i] = addresses[i];        
            }

            count_whitelist = count_whitelist.add(addresses.length);
    }

    function getTierForNewAddress() internal view returns (uint256) {

        if(count_whitelist >= 0 && count_whitelist <= 999){
            return 1;
        } else if (count_whitelist >= 1000 && count_whitelist <= 4999) {
            return 2;
        } else if (count_whitelist >= 5000 && count_whitelist<=19999) {
            return 3;
        } else {
            revert();
        }
        return 0;
    }

    function getTier(address _address) public constant returns (uint256) {
        return registrants[_address].tier;
    }

    function changeTier(address _address, uint256 _tier) onlyOwner public {
        // Must exists
        require(registrants[_address].exists);
        // tier must be 0, 1, 2 or 3
        if(_tier >= 0 && _tier <= 3){
            registrants[_address].tier = _tier;
        } else {
            revert();
        }
    }

    function removeFromList(address _address) onlyOwner public {
        // Must exist
        require(registrants[_address].exists);
        delete(registrants[_address]);
        uint i;
        bool found=false;
        for (i=0; i<count_whitelist;i++) {
            if(registrantAddr[i] == _address) {
                registrantAddr[i] = 0;
                found=true;
            }
            if(found) {
                registrantAddr[i-1] = registrantAddr[i];
            }
        }
        count_whitelist = count_whitelist.sub(1);
    }

    // @notice Pauses the whitelist if there is any issue
    function pauseWhitelist() onlyOwner public {
        paused = true;
    }

    // @notice Resumes the TokenSale
    function resumeWhitelist() onlyOwner public {
        paused = false;
    }

    function stopRegister() onlyOwner public {
        finished = true;
        endTimeRegister = now;
    }


    modifier notPaused() {
        require(!paused);
        _;
    }

    modifier notFinished() {
        require(!finished);
        _;
    }

    //////////
    // Safety Methods
    //////////

    /// @notice This method can be used by the controller to extract mistakenly
    ///  sent tokens to this contract.
    /// @param _claimtoken The address of the token contract that you want to recover
    ///  set to 0 in case you want to extract ether.
    function claimTokens(address _claimtoken) public onlyOwner {
        if (_claimtoken == 0x0) {
            owner.transfer(this.balance);
            return;
        }

        ERC20 claimtoken = ERC20(_claimtoken);
        uint balance = claimtoken.balanceOf(this);
        claimtoken.transfer(owner, balance);
        ClaimedTokens(_claimtoken, owner, balance);
    }


}
